import React from 'react'
import Icon from './Icon'
import { Link as LinkInt } from 'react-scroll'

export default function ToTop() {
  return (
    <LinkInt to="nav" smooth={true} duration={500}>
        <div className="to-top">
            <Icon icon="Top" size={30} />
        </div>
    </LinkInt>
  )
}
